create table Cars_for_Sale (
	car_for_Sale_ID INT,
	manufacturer_Shortname VARCHAR(10),
	model_Code INT,
	vehicle_Category_Code INT,
	asking_Price VARCHAR(20),
	current_Mileage INT,
	date_Acquired DATE,
	registration_Year VARCHAR(4),
	other_Car_Details VARCHAR(60),
	PRIMARY KEY(car_for_Sale_ID),
	FOREIGN KEY(manufacturer_Shortname) REFERENCES Car_Manufacturers(manufacturer_Shortname),
	FOREIGN KEY(model_Code) REFERENCES Car_Models(model_Code),
	FOREIGN KEY(vehicle_Category_Code) REFERENCES Vehicle_Categories(vehicle_Category_Code)
);
